import React ,{Component}from 'react';
import {Home} from './assets/views/Home';
import {Fournisseur}  from './assets/views/Fournisseur';
import  {Sortie} from './assets/views/Sortie';
import  {Entré} from './assets/views/Entré';
import {Statistique} from './assets/views/Statistique';
import {Alerte}  from './assets/views/Alerte';
import {Mouvements} from './assets/views/Mouvements';
import {Client} from './assets/views/Client';
import {aPropos} from './assets/views/aPropos';
import {Guide} from './assets/views/Guide';
import {ajoutArticle} from './assets/views/ajoutArticle';
import {HeatMap} from './assets/views/HeatMap';
import {LoginScreen} from './assets/views/LoginScreen';
import {DrawerContent} from './assets/views/DrawerContent';
import {AdminScreen} from './assets/views/AdminScreen';
import {MagasinierScreen} from './assets/views/MagasinierScreen';
import {MdpOubliéScreen}from './assets/views/MdpOubliéScreen';
import {SignUpScreen} from './assets/views/SignUpScreen';
import {Categorie} from './assets/views/Categorie';
import { NavigationContainer } from '@react-navigation/native';
import {createDrawerNavigator} from '@react-navigation/drawer';

import {StyleSheet} from 'react-native';

const Drawer = createDrawerNavigator();


export default function App() {
  return (

    <NavigationContainer>
    <Drawer.Navigator  drawerContent={props => <DrawerContent {...props}/>}>
      <Drawer.Screen name="Home" component={Home} />
      <Drawer.Screen name="LoginScreen" component={LoginScreen}/>
      <Drawer.Screen name="Statistique" component={Statistique}/>
      <Drawer.Screen name="HeatMap" component={HeatMap}/>
      <Drawer.Screen name="Alerte" component={Alerte}/>
      <Drawer.Screen name="Guide" component={Guide}/>
      <Drawer.Screen name="aPropos" component={aPropos}/>
      <Drawer.Screen name="Entré" component={Entré}/>
      <Drawer.Screen name="ajoutArticle" component={ajoutArticle}/>
      <Drawer.Screen name="Sortie" component={Sortie}/>
      <Drawer.Screen name="Mouvements" component={Mouvements}/>
      <Drawer.Screen name="Fournisseur" component={Fournisseur}/>
      <Drawer.Screen name="Client" component={Client}/>
      <Drawer.Screen name="Categorie" component={Categorie}/>
      <Drawer.Screen name="MagasinierScreen" component={MagasinierScreen}/>
      <Drawer.Screen name="AdminScreen" component={AdminScreen}/>
      <Drawer.Screen name="MdpOubliéScreen" component={MdpOubliéScreen}/>
      <Drawer.Screen name="SignUpScreen" component={SignUpScreen}/>
    </Drawer.Navigator>


  </NavigationContainer>
);
}

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },

  });
